        ...imgStyle,
        top: '50px',
        left: '67.5px',
    };

    const frameStyle = {
        ...imgStyle,
        top: '230px',
        left: '66.5px',
    };

    const icoCountriesStyle = {
        ...imgStyle,
        top: '581.5px',
        left: '70px',
        color: "white",
        border: '1px solid white',
        width: '300px'
    };

    const icoDisciplinesStyle = {
        ...imgStyle,
        top: '641.5px',
        left: '70px',
        color: "white",
        border: '1px solid white',
